  "text" : "\uB3CC\uC544\uC624\uC790\uBA74, \uB098\uB294 \uC548\uC5D0\uC11C \uC2F8\uC6B0\uB294 \uC0AC\uB78C\uC774\uB4E0 \uBC14\uAE65\uC5D0\uC11C \uB300\uC548\uC138\uB825\uC744 \uB9CC\uB4DC\uB294 \uC0AC\uB78C\uC774\uB4E0 \uACF5\uC815\uD558\uAC8C \uC704\uCE58\uC640 \uB9D0\uC744 \uD3C9\uAC00\uD574\uC918\uC57C \uD55C\uB2E4\uACE0 \uBCF8\uB2E4. \uAE30\uC131\uAD50\uB2E8\uC5D0\uC11C \uB300\uC548\uC801\uC778 \uBAA9\uD68C\uD558\uB294 \uC0AC\uB78C\uC774\uB098, \uACF5\uB9BD\uD559\uAD50\uC5D0\uC11C \uB300\uC548\uC801\uC73C\uB85C \uC218\uC5C5\uD558\uB294 \uC0AC\uB78C\uC774\uB098, \uB9AC\uBC84\uB7F4 \uC815\uB2F9\uC5D0\uC11C \uC9C4\uBCF4\uC815\uCC45 \uC785\uC548\uD558\uB294 \uC0AC\uB78C\uC774\uB098.",
