  "text" : "\uBA70\uCE60\uC804 \uC5B4\uB5A4 \uB17C\uAC1D\uC740 \uC9C1\uC811\uBBFC\uC8FC\uC8FC\uC758\uB97C \uC678\uCE58\uB294 \uC0AC\uB78C\uC744 \u2018\uD55C\uAC00\uD55C \uC18C\uB9AC\u2019\uB098 \uD558\uB294 \uC9C0\uC2DD\uC778\uC73C\uB85C \uB9E4\uB3C4\uD588\uB294\uB370. \uC804\uD615\uC801\uC778 \uB9E8\uC2A4 \uD50C\uB808\uC778 \uC544\uB2CC\uAC00 \uC2F6\uB2E4. \uAE30\uC131\uC815\uCE58\uC640 \uB300\uC548\uC815\uCE58\uAC00 \u2019\uAC19\uC774\u2019 \uD560 \uC218 \uC788\uB294 \uAC8C \uC911\uC694\uD55C\uB370, \uC218\uD2C0\uB9B4 \uB54C\uB9C8\uB2E4 \uC544\uB294 \uCC99 \uAE4C\uB294 \uBC29\uC2DD\uC73C\uB85C\uB294 \uC544\uBB34 \uC77C\uB3C4 \uC548 \uBC8C\uC5B4\uC9C4\uB2E4.",
