  "text" : "\uB0B4 \uC0DD\uAC01\uC5D0\uB294 \uB300\uC548\uC138\uB825\/\uB9C8\uC744\/\uACF5\uB3D9\uCCB4\uB294 \uB298 \uD544\uC694\uD558\uB2E4. \uB2E8 \uBAA8\uB450\uAC00 \uC8FC\uB958\uB97C \uBE60\uC838\uB098\uAC00\uC11C \uD558\uACE0 \uC2F6\uC740 \uC77C\uB9CC \uD55C\uB2E4\uACE0 \uC138\uC0C1\uC774 \uBC14\uB00C\uC9C4 \uC54A\uB294\uB2E4. \uC8FC\uB958\uD654 \uC804\uB7B5\uC744 \uC4F0\uB294 \uB300\uC548\uC138\uB825\uB3C4 \uC788\uACE0, \uB300\uC548\uC138\uB825\uC758 \uBA54\uC2DC\uC9C0\uB97C \uC801\uC808\uD788 \uC8FC\uB958\uC5D0 \uC774\uC2DD\uD558\uB294 \uC0AC\uB78C\uB3C4 \uD544\uC694\uD558\uB2E4. \uC815\uCC45 \uAC19\uC740 \uACBD\uC6B0\uAC00 \uADF8\uB807\uB2E4.",
