  "text" : "\uBC14\uAE65\uC5D0\uC11C \uCC2C\uBC14\uB78C\uC744 \uB9DE\uC73C\uBA70 \uD48D\uCC2C\uB178\uC219\uD558\uB294 \uB300\uC548\uC138\uB825, \uC790\uC6D0\uB3D9\uC6D0\uC744 \uD1B5\uD574 \uD799\uD558\uAC8C \uD558\uACE0 \uC2F6\uC740 \uAC70\uB97C \uD558\uB294 \uB300\uC548\uC138\uB825 \uB4F1 \uCC28\uC774\uAC00 \uC788\uC744 \uAC83\uC774\uB2E4. \uB2E4\uB978 \uD55C \uD3B8 \uBA54\uC778\uC2A4\uD2B8\uB9BC\uC758 \uC790\uC6D0\uC744 \uAC00\uC9C0\uACE0 \uC788\uC73C\uBA74\uC11C\uB3C4 \uADE0\uD615 \uC7A1\uB294 \uAC83 \uB610\uD55C \uC26C\uC6B4 \uC77C\uC740 \uC544\uB2C8\uB2E4. \uC5B4\uB290\uCABD\uB3C4 \uAC04\uB2E8\uD788 \uD3C9\uAC00\uD560 \uC218\uB294 \uC5C6\uB2E4.",
