  "text" : "\uC9C8\uBB38\uC740 \uAC04\uB2E8\uD55C\uB370, \uD480\uB9CC\uD55C \uC5EC\uB825\uC774 \uB204\uAD6C\uC5D0\uAC8C\uB3C4 \uC5C6\uB294 \uAC83 \uAC19\uB2E4. \uD55C\uAD6D\uC0AC\uB78C\uC73C\uB85C\uC11C \uB098\uB77C\uB3C4 \uC798 \uD558\uC790\uB294 \uC0DD\uAC01\uC774 \uC18C\uADF9\uC801\uC774\uB77C\uBA74, \uADF8 \uC774\uC0C1\uC758 \uBB54\uAC00\uB97C \uD560 \uC218 \uC788\uB294 \uBC30\uC6C0\uC758 \uC790\uB9AC\uAC00 \uC788\uC5B4\uC57C \uD55C\uB2E4. \uB2E4\uB978 \uD55C \uD3B8 \uADF8\uB7F0 \uD604\uC7A5\uC5D0\uC11C \uC544\uC774\uB4E4\uC744 \uD3EC\uAE30\uD558\uC9C0 \uC54A\uB294 \uAD50\uC0AC\uB4E4\uC5D0\uAC8C \uC751\uC6D0\uC744 \uBCF4\uB0B8\uB2E4.",
