  "text" : "\uB0A8\uC790\uAC00 \uBD99\uB4E4\uC5B4\uC57C \uD558\uB098 \uC544\uB2C8\uBA74 \uC5EC\uC790\uAC00 \uAC00\uB974\uCCD0\uC57C \uD558\uB098. \uACF5\uBD80\uB294 \uC140\uD504\uB2C8\uAE4C \uACC4\uC18D \uACA9\uB9AC\uB41C \uACF5\uAC04\uC5D0\uC11C \uC820\uB354 \uAC10\uC218\uC131\uC744 \uAC16\uCD94\uB2C8 \uC54A\uC73C\uBA74 \uC0AC\uD68C\uC5D0 \uB098\uC624\uC9C0 \uBABB\uD558\uAC8C \uC870\uCE58\uD574\uC57C \uD558\uB098. \uBB3C\uB860 \uB300\uB2E4\uC218 \uB0A8\uC131\uB4E4\uC774 \uC774\uBBF8 \uC9C0\uBC30\uC601\uC5ED\uC758 \uC8FC\uB958\uB2E4. \uADF8\uB807\uB2E4\uBA74 \uADF8\uB4E4\uC740 \uCAD3\uC544\uB0B4\uC57C \uD558\uB098 \uAC31\uC0DD\uC2DC\uCF1C\uC57C \uD558\uB098.",
